INSERT INTO `question` VALUES ('949', '2019-04-24 08:48:18', '2019-04-30 01:06:56', '2019-05-03', '2019-04-22', null, null, null, null, '2', null, '\0', null, '2019-05-08', '2019-04-26', '<p>我们需要进行敏捷测试。</p>', '1', '<p>请将以下<span id=\"thread_subject\">敏捷项目中的测试活动流程进行排序：1：开发测试用例，2：制定测试计划，3：确定测试方案，4：执行测试，5：完成测试报告，6：确定系统需求和约束</span></p>', '598', '93', '2', '497', '520', '7', '3', null, '');
INSERT INTO `question` VALUES ('950', '2019-04-24 08:49:16', '2019-04-28 10:40:16', '2019-05-08', '2019-04-23', null, null, null, null, '2', null, '\0', null, '2019-05-15', '2019-04-23', '<p>对敏捷术语的测试</p>', '1', '<p>下列哪一个不是敏捷开发中常用的术语？</p>', '575', '111', '2', '497', '501', '8', '498', null, '');
INSERT INTO `question` VALUES ('951', '2019-04-24 08:49:55', '2019-04-28 11:11:02', '2019-05-01', '2019-04-22', null, null, null, null, '2', null, '\0', null, '2019-05-16', '2019-04-23', '<p>回顾会议作为一个迭代周期的结尾的团队活动，担负着总结工作情况，根据工作情况进行及时反馈和修正的作用。</p>', '1', '<p>回顾会议主要包括哪些过程？</p>', '520', '86', '2', '497', '759', '8', '3', null, '<p>一般的，回顾会议分为这么几个部分: <br />1.启动&mdash;&mdash;宣布开始，特殊事项宣布 <br />2.团队陈述&mdash;&mdash;多团队共同回顾，各个团队选一个人进行工作总结 <br />3.收集数据&mdash;&mdash;发便签纸和笔，个人回顾做的好的，做的有待改进的 <br />4.公示数据&mdash;&mdash;将每个人回顾的内容张贴在白板上，两个区域好的和改进的，大家自由讨论（15分钟），解释和讨论 <br />5.选择改进，每人3张票，进行改进措施投票，根据投票结果确定改进事项 <br />6.公布，公布需要改进的措施，并转换为任务卡 <br />7.感谢，每个人写一张感谢卡，给要感谢的人 <br />8.结束，happy end</p>');
