INSERT INTO `question` VALUES ('953', '2019-04-24 08:51:00', '2019-05-06 12:04:35', '2019-05-22', '2019-04-22', null, null, null, null, '2', null, '', null, '2019-05-29', '2019-04-24', '<p>在敏捷团队中,测试是整个项目组的&ldquo;车头灯&rdquo;，它告诉大家现在到哪了，正在往哪个方向走。测试员为项目组提供丰富的信息，使得项目组基于这些可靠的信息作出正确的决定。不仅是测试员要保证质量，而是整个项目组的每一个人都要对质量负责。测试员不跟开发人员纠缠错误，而是帮助他们找到目标,共同为达到项目的最终目标而努力。</p>', '1', '<p>敏捷测试也需要高度迭代工作、频繁得到客户的反馈，需要动态调整测试计划、测试的执行。并且，敏捷测试人员参与到了更多的敏捷生产活动中，积极的影响了团队做出的决定和计划，你觉得测试自动化会给高度迭代测试带来什么好处？</p>', '520', '93', '699', '497', '598', '8', '698', null, '<p>这是一道开放性问题，请自由发挥</p>');
