INSERT INTO `question_choice` VALUES ('891', '2019-04-23 15:14:32', '2019-05-01 07:39:35', 'A', '<p>TDD的原理是在开发功能代码之前，先编写单元测试用例代码，测试代码确定需要编写什么产品代码</p>', '', '783');
INSERT INTO `question_choice` VALUES ('892', '2019-04-23 15:14:53', '2019-05-01 07:39:44', 'B', '<p>TDD的基本思路就是通过测试来推动整个开发得进行，但测试驱动开发并不只是单纯的测试工作，而是把需求分析，设计，质量控制量化的过程。</p>', '', '783');
INSERT INTO `question_choice` VALUES ('893', '2019-04-23 15:15:07', '2019-05-01 07:39:49', 'C', '<p>TDD的重要目的不仅仅是测试软件，测试工作保证代码质量仅仅是其中一部分，而且是在开发过程中帮助客户和程序员去除模棱两可的需求。</p>', '', '783');
INSERT INTO `question_choice` VALUES ('894', '2019-04-23 15:15:19', '2019-05-01 07:39:55', 'D', '<p>TDD首先考虑使用需求（对象、功能、过程、接口等），主要是编写测试用例框架对功能的过程和接口进行设计，而测试框架可以持续进行验证。</p>', '', '783');
